    <div class="navbar-nav bg-dark">
            
    </div>
);

const SubNav = () =>{
    return subNav;
}



const nav = (
<nav className="navbar navbar-expand-lg navbar-light bg-light">
    <a className="navbar-brand text-primary" href="#">Daher</a>
    <SubNav />
</nav>);


const Nav = () => {
    return nav;
}
export default Nav;
